data:
  definition: technique de câblage par impression dans laquelle les connexions entre
    les composants d'un dispositif électrique ou électronique ou d'une partie de celui-ci,
    y compris les éléments de blindage, consistent en des bandes conductrices minces
    situées à l'intérieur ou liées à la surface d'un matériau de base et dans laquelle
    tous les composants fonctionnels sont séparés du matériau de base
  examples: []
  notes: []
